// src/HomePage.tsx

import React, { useContext } from "react";
import "./HomePage.css";
import { Link, Element, animateScroll as scroll } from "react-scroll";
import { ThemeContext } from "./themeContext";

const HomePage: React.FC = () => {
  const { theme, toggleTheme } = useContext(ThemeContext);

  const scrollToTop = () => {
    scroll.scrollToTop();
  };

  return (
    <div className="home-page">
      <button
        className="interactive-button to-top-button"
        onClick={scrollToTop}
        style={{ backgroundColor: theme.button }}
      >
        â–²
      </button>

      <div className="navbar">
        <button
          className="interactive-button"
          style={{ backgroundColor: theme.button }}
        >
          <Link
            activeClass="active"
            to="section1"
            spy={true}
            smooth={true}
            offset={-70}
            duration={500}
          >
            Home
          </Link>
        </button>
        <button
          className="interactive-button"
          style={{ backgroundColor: theme.button }}
        >
          <Link
            activeClass="active"
            to="section2"
            spy={true}
            smooth={true}
            offset={-70}
            duration={500}
          >
            Resume
          </Link>
        </button>
        <button
          className="interactive-button"
          style={{ backgroundColor: theme.button }}
        >
          <Link
            activeClass="active"
            to="section3"
            spy={true}
            smooth={true}
            offset={-70}
            duration={500}
          >
            Projects
          </Link>
        </button>
        <button
          className="interactive-button"
          style={{ backgroundColor: theme.button }}
        >
          <Link
            activeClass="active"
            to="section4"
            spy={true}
            smooth={true}
            offset={-70}
            duration={500}
          >
            Photography
          </Link>
        </button>
        <button
          onClick={toggleTheme}
          className="theme-toggle"
          style={{ backgroundColor: theme.toggle }}
        >
          ðŸŒ—
        </button>
      </div>

      {/*Home Section*/}
      <Element
        name="section1"
        className="element"
        style={{ backgroundColor: theme.section }}
      >
        <h1>Welcome to my Website!</h1>
        <p> Hello and welcome,

My name is Shivam Ratnani,</p> 
<p> and I am a dedicated software engineer with a passion for solving complex problems and building innovative solutions. 
With a strong foundation in Java, Python, C#, C++, Html, CSS, and React.js(The language this website is written in), I bring a unique approach to developing high-quality, efficient, and reliable software.

Throughout my career, I've had the privilege to contribute to a variety of projects ranging from [type of projects or applications you've worked on], each of which has reinforced my commitment to continual learning, attention to detail, and result-driven execution.

This portfolio is a curated representation of my technical skillset, showcasing projects that I'm particularly proud of. Each one has been a journey of growth, pushing the boundaries of my knowledge and skills.

Thank you for taking the time to visit. I look forward to potentially collaborating on future software endeavors.

Best Regards,
[Your Name] </p>

        {/*LinkedIn button*/}
        <button
          className="interactive-button"
          style={{ backgroundColor: theme.button }}
        >
          <Link to="https://www.linkedin.com/in/shivam-ratnani-9b0b3a1a0/">
            LinkedIn
          </Link>
        </button>

        {/*Github button*/}
        <button
          className="interactive-button"
          style={{ backgroundColor: theme.button }}
        >
          <Link to="https://github.com/shivamratnani">Github</Link>
        </button>
      </Element>

      <Element
        name="section2"
        className="element"
        style={{ backgroundColor: theme.section }}
      >
        <h1>Resume</h1>
        <p>Your inline resume goes here</p>
        <a
          href="link-to-your-resume.pdf"
          download
          className="interactive-button"
          style={{ backgroundColor: theme.button }}
        >
          Download Resume
        </a>
      </Element>

      <Element
        name="section3"
        className="element"
        style={{ backgroundColor: theme.section }}
      >
        <h1>Projects</h1>
        {Array(5)
          .fill(0)
          .map((_, index) => (
            <div key={index}>
              <h2>Project {index + 1}</h2>
              <p>Brief overview of the project goes here</p>
              <a
                href="link-to-project"
                className="interactive-button"
                style={{ backgroundColor: theme.button }}
              >
                Project Link
              </a>
            </div>
          ))}
      </Element>

      <Element
        name="section4"
        className="element"
        style={{ backgroundColor: theme.section }}
      >
        <h1>Photography</h1>
        <p>Your inline website view goes here</p>
        <a
          href="link-to-your-photography-website"
          className="interactive-button"
          style={{ backgroundColor: theme.button }}
        >
          Visit Photography Website
        </a>
      </Element>
    </div>
  );
};

export default HomePage;
